import React from "react";
import  "./LandingPage.css"
import { render } from "react-dom";
// core components
import SearchBox from "../../components/Search/SearchApp.js";
import ExamplesNavbar from "components/Navbars/ExamplesNavbar.js";
// import LandingPageHeader from "components/Headers/LandingPageHeader.js";
import DefaultFooter from "components/Footers/DefaultFooter.js";
import MenuTiles from '../../MenuTiles';
import HomePage from 'pages/homepage/homepage.component';
import Slider from "react-animated-slider";
import "react-animated-slider/build/horizontal.css";
import "normalize.css";
import "./slider-animations.css";
import "./sliderstyles.css";

const content = [
  {
    title: "AI ECONOMICS",
    description:
      "AI Economic deals with our specialized dataset graph which gives detailed information on the economical products and their rotation.",
    button: "Click here to Expand",
    image: "https://ak7.picdn.net/shutterstock/videos/1019040067/thumb/9.jpg",
    // user: "Luan Gjokaj",
    // userProfile: "https://i.imgur.com/JSW6mEk.png"
  },
  {
    title: "Tortor Dapibus Commodo Aenean Quam",
    description:
      "Nullam id dolor id nibh ultricies vehicula ut id elit. Cras mattis consectetur purus sit amet fermentum. Morbi leo risus, porta ac consectetur ac, vestibulum at eros. Donec sed odio dui.",
    button: "Discover",
    image: "https://i.imgur.com/DCdBXcq.jpg",
    user: "Erich Behrens",
    userProfile: "https://i.imgur.com/0Clfnu7.png"
  },
  {
    title: "Phasellus volutpat metus",
    description:
      "Lorem ipsum dolor sit amet, consectetur adipiscing elit. Cras mattis consectetur purus sit amet fermentum. Cras justo odio, dapibus ac facilisis in, egestas eget quam. Duis mollis, est non commodo luctus, nisi erat porttitor ligula.",
    button: "Buy now",
    image: "https://i.imgur.com/DvmN8Hx.jpg",
    user: "Bruno Vizovskyy",
    userProfile: "https://i.imgur.com/4KeKvtH.png"
  },
  {
    title: "Ultricies Vulputate Mollis Fermentum Parturient",
    description:
      "Aenean eu leo quam. Pellentesque ornare sem lacinia  nibh, ut fermentum massa justo sit amet risus. Cras justo odio, dapibus ac facilisis.",
    button: "Read More",
    image: "https://i.imgur.com/ZXBtVw7.jpg",
    user: "Luan Gjokaj",
    userProfile: "https://i.imgur.com/JSW6mEk.png"
  },

];

function SliderItem({ item }) {
  return (
    <div
      className="slider-content"
      style={{ background: `url('${item.image}') no-repeat center center` }}
    >
      <div className="inner">
        <h1>{item.title}</h1>
        <p>{item.description}</p>
        <button>{item.button}</button>
      </div>
      <section>
        {/* <img src={item.userProfile} alt={item.user} /> */}
        {/* <span>
          Posted by <strong>{item.user}</strong>
        </span> */}
      </section>
    </div>
  );
}

const App = () => (
  <div>
    {/* <h1>{content.length} elements autoplay 1s</h1> */}
    <Slider className="slider-wrapper" autoplay={2000}>
      {content.map((item, index) => (
        <div
          key={index}
          className="slider-content"
          style={{ background: `url('${item.image}') no-repeat center center` }}
        >
          <div className="inner">
            <h1>{item.title}</h1>
            <p>{item.description}</p>
            <button>{item.button}</button>
          </div>
          <section>
            <img src={item.userProfile} alt={item.user} />
            <span>
              Posted by <strong>{item.user}</strong>
            </span>
          </section>
        </div>
      ))}
    </Slider>

  </div>
);

// render(<App />, document.getElementById("root"));



function LandingPage() {
  const [firstFocus, setFirstFocus] = React.useState(false);
  const [lastFocus, setLastFocus] = React.useState(false);
  React.useEffect(() => {
    document.body.classList.add("landing-page");
    document.body.classList.add("sidebar-collapse");
    document.documentElement.classList.remove("nav-open");
    return function cleanup() {
      document.body.classList.remove("landing-page");
      document.body.classList.remove("sidebar-collapse");
    };
  });

  const footer = {
      paddingTop: '50px'
  };

  return (
   <>
    <ExamplesNavbar />

      <div className="wrapperclass">

        <div className="searchBox">
        <SearchBox />

        </div>
        <div className="slider">
        <App />
        </div>

        <div className="menuTiles">
        <HomePage />
        {/* <MenuTiles /> */}
        </div>

        <div class="footer" style= {footer} >
        <DefaultFooter />
        </div>

      </div>
    </>
  );
}

export default LandingPage
